INSERT INTO `quiz_evaluation` (`id`, `quizid`, `categoryId`, `categoryName`, `minScore`, `maxScore`, `evaluation`, `suggestion`, `type`, `healthStatus`, `explanation`, `feature`) VALUES
	(1, 3, 2, '支配型', 0, 999, '◇在沟通中，您比较讲究信息的准确性和直接性，所以希望对方的提供的信息是准确的。您喜欢直接的沟通，不太喜欢拐弯抹角，所以对方尽量不要有太多寒暄，直奔主题会更有效。\n◇您在沟通中，一般声音比较洪亮且自信满满，语速比较快。如果您听到沟通对方的声音比较小，那么你会认为他没有底气。而且，您在沟通中会寻求与对方的目光接触，如果有人刻意回避与您的目光接触，那么您也会觉得沟通受阻，且对对方没有什么信心，产生很大的怀疑。', '◇在沟通中，您比较容易通过对方的语音、语调和眼神等外在表现来判断一个人，所以容易形成思维定式，忽略了谈话的实质内容部分，从而影响了您的决策和判断。所以，在沟通前尽量提醒自己，不要太受外在表现的影响，多关注沟通的实质内容。\n◇在沟通中，如果太过讲究沟通的效率和结果，对开放式的问题没有太多容忍度，会导致忽视沟通中对方的情绪，以及与对方产生的情感联结等，给对方造成太过强势，甚至咄咄逼人的印象。\n◇在沟通中，您通常直奔主题，不喜欢拐弯抹角 ，情感较少表露，面部表情也很少，有时候会给对方一种冷漠的感觉，建议沟通前可适当寒暄，为下面的沟通做好铺垫。', 'singleMain', '', '', '◇果断 ◇有作为 ◇有决策力 ◇强调效率 ◇独立 ◇说话快且有说服力 ◇热情 ◇语言直接，有目的性 ◇面部表情比较少 ◇使用日历 ◇情感不外露 ◇计划性强'),
	(2, 3, 3, '表达型', 0, 999, '◇因为在沟通中，您的声音比较洪亮、生动活泼，所以在跟您沟通中，您也偏好声音洪亮的个体。\n◇在沟通中，当您做出动作或者手势来表达观点时，您需要对方的眼神的肯定。如果您觉得对方对您的工作没有关注时，您会感到非常失望。\n◇您在沟通是比较直率的，说话比较直接。所以，您也期待对方跟您一样，说话直接。如果对方说话拐弯抹角，那么您会慢慢失去耐性，从而出现不耐烦等情绪而影响沟通。', '◇ 在您的沟通中，比较容易出现的问题是，在描述问题时只见森林，不见树木。所以您在总体上阐述一些事情之后，请就某些细节进行适当阐述。如果您在沟通中可能会忽略这些，请在沟通前就准备好相关细节资料。\n◇ 很多时候，您不太注重细节，甚至有可能说完就忘了。所以您在沟通中，要随时准备笔记记录，在达成协议以后，最好与之进行一个书面的确认，这样可以给自己一个提醒。\n◇您在沟通中，对沟通对象的某些行为，如声音、眼神等会有所偏好，这些外在条件可能会限制自己的交往范围，影响沟通效果，需要您加以注意。\n◇您在沟通过程中，对沟通内容和自我的感受关注地可能会更多一点，有时候会忽略对方的感受，建议您在沟通的过程中也要对沟通对象的感受适当予以关注。', 'singleMain', '', '', '◇外向 ◇合群 ◇直率 ◇友好 ◇活泼 ◇热情 ◇快速的动作 ◇不注重细节 ◇生动活泼、抑扬顿挫的语调 ◇令人信服 ◇有说服力的语言 ◇幽默 ◇陈列有说服力的物品'),
	(3, 3, 4, '和蔼型', 0, 999, '◇总体来说，您在沟通中说话语速较慢，不会给对方造成很大的压力，也没有咄咄逼人的感觉，相反，对方会觉得你很亲切、很有耐心、和蔼，很好说话。\n◇在沟通中，相对于沟通的结果来说，您更看中沟通双方之间的良好关系和情感联结。如果对方不向您个人询问意见，一般情况下，即使您有很好的意见和建议，您也不会主动提出。\n◇您在沟通中，会时刻观察对方的情绪，比如对方的面部表情的变化、手势的变化等等。您最舒服的沟通对象是时刻充满微笑的人。一旦您发现对方的表情有所变化，您会立刻担心自己是不是说错话了。', '◇在沟通中，您太容易偏重与对方的情感沟通，所以建立良好的关系是您沟通的主要目标。因此，您可能会忽视沟通的效率和沟通的结果。如果您在沟通前计划一下沟通的目标，列举沟通的要点，就会大大地提高沟通的效率，对方也不会觉得您在某些时候在浪费时间。\n◇在沟通中，您不会给对方造成太大的压力，也不喜欢对方对您太过强势。您在某些时候要改变沟通的态度。如果对方的某些态度不太符合您的预期，您要改变自己刻板的想法，要知道，不同的人做事方法千差万别，沟通风格也有很大不同。对方强硬直接的态度，针对的只是沟通的问题上，并不是针对你们之间的个人关系。经常提醒自己这些问题，可能会减少您的某些负面情绪，从而促进沟通。', 'singleMain', '', '', '◇合作 ◇和蔼可亲 ◇友善 ◇频繁的目光接触 ◇赞同 ◇说话慢条斯理 ◇有耐心 ◇声音轻柔,抑扬顿挫 ◇轻松 ◇喜欢鼓励别人'),
	(4, 3, 5, '分析型', 0, 999, '◇在沟通中，您喜欢尽快直入主题，不喜欢冗长的迂回婉转。而且您喜欢边说边写，有一丝不苟的认真精神。<br/>\n◇您不太喜欢太多的眼神交流，更不喜欢太多的身体接触。如果有条件，跟对方保持一定的物理空间距离也会让您感觉舒适。<br/>\n◇在沟通中，您更偏爱专业术语、数据、计划书、图表等，这让您觉得这样的沟通更有逻辑，且分析性更强。如果对方的言语中只是充满个人主观性的评价和词语等，您会觉得太不专业，没有条理，不会很满意这样的沟通。', '◇专业术语、数据、计划书、图表是会有利于沟通，但是不能在所有类型的沟通中一味地追求这样的风格。\n◇您不太喜欢太多的眼神交流，还喜欢与对方保持一定的距离，这会给对方造成很多不良的印象，甚至会给人一种拒人于千里之外的感觉。在某些沟通中，适当与人保持情绪沟通，也是很有必要的。\n◇您在与对方沟通时喜欢直入主题，不喜欢冗长的迂回婉转，有时候适当的情感铺垫可能会更有利于接下来的沟通。', 'singleMain', '', '', '◇ 不太喜欢说话 ◇ 面部表情少 ◇ 严肃认真 ◇ 动作慢 ◇ 有条不紊 ◇ 合乎逻辑 ◇ 语调单一 ◇ 注意细节 ◇ 有计划有步骤 ◇ 喜欢使用图表 ◇ 喜欢有较大的个人空间'),
	(5, 3, 2, '支配型', 0, 999, '在这个团体中，大部分人沟通时比较果断，不会很热情，他们看重沟通的结果，比较讲究信息的准确性和直接性，不太喜欢拐弯抹角的沟通。所以，在与这样的团体打交道中，尽量不要有太多寒暄和发散，直奔主题会更有效。这样的团体比较喜欢声音洪亮语速较快的谈话，也喜欢目光接触。所以，与这样的团体沟通的人，需要注意自己的外在表现，在沟通中尽量声音洪亮且自信满满会比较容易达成更好的沟通效果。', '', 'teamMain', '', '', ''),
	(6, 3, 3, '表达型', 0, 999, '在这个团体中，大部分人是比较友好、活泼和热情的，喜欢在沟通中配合动作和手势。另外，赞扬和肯定对他们很重要，这个团队成员大部分会很快抓住问题的实质，或者说主要问题，但可能容易忽略细节。所以，在与这样的团队沟通时，说话需直接，还需要叮嘱其注意记录信息，且留意细节问题。另外，多给与肯定和表扬也是很重要的。', '', 'teamMain', '', '', ''),
	(7, 3, 4, '和蔼型', 0, 999, '这个团体中，大部分人是比较和蔼、亲切、很好交流的。他们比较注意照顾对方的情绪。在沟通中，他们比较看重彼此间的情感沟通，所以可能会忽视沟通的效率和沟通的结果。所以，在与这样的团队沟通时，说话的语速要比较慢，多面带微笑，多眼神接触，还要多鼓励。如果想知道个别人的建议，需要点名提问，不然他们不会主动发表意见。', '', 'teamMain', '', '', ''),
	(8, 3, 5, '分析型', 0, 999, '这个团体中，大部分人是比较偏爱逻辑性强、分析性强的沟通，如在沟通中更多地使用专业术语、数据、计划书、图表等。他们一般很认真、严肃，不太喜欢太多的眼神交流，也不喜欢太多的身体接触。所以，在与这样的团队沟通时，如果你也边说边写，表现得更他们一样认真，如果还能列举一二三四，体现你的逻辑思维能力，再配上图表，那么你们的沟通会更加顺畅。', '', 'teamMain', '', '', ''),
	(9, 4, 6, '整合型', 0, 999, '◇您很善于处理问题，在处理问题时比较理性，能够顾忌他人感受，而且还会同时兼顾自己和他人的利益。\n◇您在工作中比较受欢迎，会支持和体谅别人，在遇到问题或者与同事冲突时也不会逃避和畏缩，会积极地尝试各种办法与他人一起解决问题。解决问题比较有条理，大部分时候能够站在客观中立的立场上处理问题。', '◇当同时兼顾他人感受和自己感受时，在某些程度上，或者某些特定的问题上，会影响解决问题或者解决冲突的效率。更特别的情况下，根本不存在兼顾所有人的解决方法。所以适当地根据具体的问题，灵活变换自己的冲突解决策略，会得到更好的效果。', 'singleMain', '', '', ''),
	(10, 4, 7, '回避型', 0, 999, '◇您不那么爱出风头，不管你的内心多么地抗拒或者不乐意，但是您不会轻易表现出来。一般情况下，会给对方比较沉默、有耐性的印象。您很容易从冲突中退出，逃避或者转移话题、不发言不表态等从而避免在当下讨论冲突。\n◇为了保持表面的和谐，也有可能是因为内心对冲突的恐惧，您可能会在问题出现时保持沉默，或者在冲突来临时选择逃避，好像冲突不存在一样，这其实是一种逃避行为。', '◇您要意识到，很多时候，逃避问题就好像把房间里的垃圾都清扫到床底下一样，乍看起来，房间干净了，其实这只是表面的干净。同样，逃避问题不是解决冲突的根本办法，问题依然还在。勇敢地面对问题，面对冲突，建设性地、积极主动地解决问题和冲突，是您需要努力的方向。', 'singleMain', '', '', ''),
	(11, 4, 8, '支配型', 0, 999, '◇您在冲突处理和问题解决中，自信、独立、有主见，有强烈的成功欲望和雄心壮志，且爱冒险，喜欢用自己的方法解决问题。当问题来临时，不会逃避冲突，也不会一味地迁就他人，会积极主动地解决冲突，虽然解决冲突的方法可能会比较粗暴，比较自我中心。\n◇一般情况下，您对待别人比较挑剔。在比较极端的情况下，您对其他人的考虑较少，会将自己的观点强加到别人身上，可能会给别人留下自大和有攻击性的印象。', '◇自信、有主见是您的优点，但是提醒您在某些时候需要更多顾及他人感受，避免在不经意情况下侵犯了他人的空间。如果有问题需要马上处理，最好先让自己平静一下，列出双方的观点，客观地评价双方，从而找出有利于双方的建设性解决方案。很多时候，冲突的解决并非或赢或输的零和问题，而是一个可以互利的双赢问题。\n◇您在处理问题时比较积极主动，注重冲突解决的效率，有时候解决冲突的方法可能会比较粗暴，这样不利于问题的解决，建议您有时候也需要注意冲突处理的艺术。', 'singleMain', '', '', ''),
	(12, 4, 9, '谦让型', 0, 999, '◇在遇到问题时，您一般想到的是首先满足他人的需要，重视团队，乐于助人，有很强的协作精神。\n◇您不那么爱出风头，很多时候会把别人的想法和利益看得比自己的更重要，能够更多地顾及他人感受，也会相应地承担更多担忧和焦虑。', '◇有句话说，退一步海阔天空。虽然谦让是种美德，但是我们希望你能够更多考虑自己的感受，学会爱己如人，不要一成不变只会付出。要学会尊重自己的利益和感受，提醒自己，要多分些时间和精力关心自己，不要总把问题都放在自己身上。', 'singleMain', '', '', ''),
	(13, 4, 10, '折中型', 0, 999, '◇在遇到问题时，一般情况下，您不会选择逃避，而是主动寻求问题的解决方案。在寻找方案的过程中，您会尽量做到公平，会考虑到所有人的利益，能够体谅和支持别人。\n◇您不会像支配型的个体那么爱出风头，也不会像谦让型个体那么牺牲自己成就他人，您会尽量选择一个大家都能接受的方案，虽然这个方案可能不是最佳的那一个。', '◇在冲突处理过程中，各退一步很多时候很有效果，也符合中庸之道。但是，在工作环境中，在某些问题的处理上，如果大家再往前进一步，再多做一些研究，多做一些探索和发掘，实现双赢，而不是双输，可能问题解决更有效。', 'singleMain', '', '', ''),
	(14, 4, 6, '整合型', 0, 999, '在冲突处理和问题解决中，这个团队的大部分重视团队，乐于助人，有很强的协作精神。因为团队中大部分人喜欢采用整合型的冲突处理方式，所以该团队团队凝聚力比较高，气氛也比较好。但是因为这种团体某些极端情况下，会有点偏向完美主义，从而影响问题解决的效率，所以给他们安排时间截止点，并适时地督促他们解决问题会更好。', '', 'teamMain', '', '', ''),
	(15, 4, 7, '回避型', 0, 999, '在冲突处理和问题解决中，这个团队的大部分人会选择漠视、逃避等态度，不够积极，也不太爱出风头，不太愿意发言，也不表态。因为团队中大部分人喜欢采用逃避性的冲突处理方式，所以虽然可能存在很多问题，但这些问题都深埋在表面之下。这种团队比较适合由整合型或者支配型的冲突处理方式的人带领。', '', 'teamMain', '', '', ''),
	(16, 4, 8, '支配型', 0, 999, '在冲突处理和问题解决中，这个团队的大部分人是比较有想法、有主见的。当问题来临时，不会逃避，不会妥协，会积极主动地解决冲突，虽然解决冲突的方法可能会比较粗暴。因为团队中大部分人喜欢采用支配型冲突处理方式，所以达成一致意见的时间会比较长。这种团队比较适合由整合型或者折中型的冲突处理风格的人带领。', '', 'teamMain', '', '', ''),
	(17, 4, 9, '谦让型', 0, 999, '在冲突处理和问题解决中，这个团队的大部分人重视团队，乐于助人，有很强的协作精神，而且会把别人的需求放在自己的需求之前，能够很好地顾及他人感受。但是因为团队中大部分人都喜欢采用谦让的冲突处理方式，所以很多时会忽视自己的角度，看问题不够全面。这种团队比较适合由整合型的冲突处理方式的人带领。', '', 'teamMain', '', '', ''),
	(18, 4, 10, '折中型', 0, 999, '在冲突处理和问题解决中，这个团队的大部分人不会选择逃避问题，而是主动寻求问题的解决方案。在寻找方案的过程中，他们也会尽量做到公平，会考虑到所有人的利益，会尽量选择一个大家都能接受的方案，虽然这个方案可能不是最佳的那一个。因为团队中大部分人喜欢折中型的冲突处理方式，所以在某些问题的处理上不够完善。如果大家再往前进一步，再多做一些研究，多做一些探索和发掘，效果可能更好。这种团队比较适合由整合型冲突处理方式的人带领。', '', 'teamMain', '', '', ''),
	(19, 5, 11, '总分', 0, 144, '您的心理健康状况处于较低水平，提醒您要特别关注自己的身心健康状况，如果有需要，请及时寻求EAP老师、心理咨询师的帮助。', '您的心理健康总分比较低。这表明，您可能对自己的优势认识不足，对自己的评价不高，对未来没有信心；您对日常生活和工作中的某些事件可能会有某些偏激的看法；有时候您会有明显的负面情绪，并且，您缺少特别好的方法去处理和控制这些情绪。因此这些情绪对您的影响程度较大、影响时间较长。您最近的状态不太好，工作效率不高；您也不太愿意参加各种聚会，与别人建立特别亲密的关系。总体来说，您需要特别留意自己的心理健康状态，及时采取措施来提高自己的心理健康水平。', 'singleMain', '较差', '', ''),
	(20, 5, 11, '总分', 145, 167, '您的心理健康状况已经处于红色警戒区域，提醒您要开始关注自己的身心健康状况。', '您的心理健康总分不高。这表明，您可能对自己和未来的信心还不够强，不足以为您提供足够的心理动力。而且您对日常生活和工作中的某些事件的看法比较片面。有时候您会出现明显的负面情绪，这种情绪对您的影响程度较大、影响时间较长；您最近的状态可能不是特别好，工作效率不是特别高；您也不太愿意参加各种聚会，与别人建立特别亲密的关系。总体来说，您的心理健康水平已经影响到了您的工作和生活，需要给与其足够的重视。', 'singleMain', '不良', '', ''),
	(21, 5, 11, '总分', 168, 191, '您的心理健康状况处于一般状态，提醒您，心理健康状态还有进一步提升的空间。', '您的心理健康总分处于中等水平。这表明，您可能对自己和未来的信心不足，有时候也会有某些偏激或者片面的想法。而且您会表现出某些负面情绪，您不能每次都处理好这些情绪。您最近的状态一般，工作效率不好也不坏；遇到困难时，还有几个可以求助的对象。总体来说，您的心理健康对您的生活和工作没有太大影响。如果进一步提升健康水平，将有助于您的工作和生活。', 'singleMain', '中等', '', ''),
	(22, 5, 11, '总分', 192, 215, '您的心理健康状况总体比较良好，希望您继续保持这种良好的状态。', '您的心理健康总分处于较好水平。这表明，您可能对自己的评价还比较积极，对未来也有一定的信心，对日常生活和工作中的某些事件的看法也比较乐观向上；有时候您会有明显的负面情绪，但对您的影响不是特别大，您有办法处理好这些情绪。您最近的状态还行，也能处理好生活和工作中遇到的问题。总体来说，您的心理健康状态对您的工作和生活有积极的作用，希望您再接再厉。', 'singleMain', '较好', '', ''),
	(23, 5, 11, '总分', 216, 240, '您的心理健康状况总体非常好，身边的人都能感受到您身上散发出来的正能量，希望您继续保持这种状态，并能适当地引导他人。', '您的心理健康总分较高。这表明，您对自己的评价一直比较积极，对未来也有一定的信心，能够提供足够的心理动力；对日常生活和工作中的某些事件的看法也比较积极向上；虽然也会出现负面情绪，但是您控制情绪和处理情绪的能力都比较强；您最近的状态不错，能妥善处理好生活和工作中遇到的各种问题。总体来说，您的心理健康状况很有利于您的工作和生活。', 'singleMain', '非常好', '', ''),
	(24, 5, 12, '积极心态', 0, 31, '由于过去一些经历的影响，您对自己的评价比较负面，对未来的生活也没有太多信心；关于工作和日常生活的一些问题，您的看法和观点常常很消极。总体上说，您的心态不够积极，对生活的热情度不够，您的幸福感整体来说处于较低水平。', '您应该改变自己固着在头脑中的比较偏激的想法和观点；更加乐观、积极地对待生活和工作，发现生活和工作中小细节或者小事件带来的幸福和快乐；建议多看一些身心灵相关的个人成长书籍，扩展自己的眼界，提高自己的身心修养。您还可以多关注和参加身心工作坊、读书会或者读书沙龙活动，吸收新观点，认识新朋友。', 'singleMain', '较低', '', ''),
	(25, 5, 12, '积极心态', 32, 36, '您对自己的评价比较中肯，虽然偶尔会担心未来的生活，但是还会努力地调整自己来应对未来的生活。您对生活的态度有消极的一面，也有积极的一面。总体来说，您的幸福感属于处于中等水平。', '您可以尝试多接触充满正面情绪的人和事物，适当地远离消极和负面情绪的个体，让自己多接触正能量；改变自己对某些事物的固有的看法，以更加开放的心态面对接触到的人和事。另外，当有负面情绪出现的时候，建议您不能一味拒绝或者否认，而应该以更加温和的态度对待之，从而发现内心最真实的自己。', 'singleMain', '中等', '', ''),
	(26, 5, 12, '积极心态', 37, 999, '您对自己的评价比较高，虽然也会意识到未来的不确定性，但还是对未来充满了信心。您对生活和工作的态度积极乐观，对生活也通常是充满热情，您的幸福感整体来说比较高。', '建议您在一定程度上多维持这种积极的、正面的状态，以及对生活和工作的热情，让您的正能量辐射到更多的人，从而影响到他人的心态；另外，建议您对极少出现的负面情绪给予积极的关注，从中发现自己内心的真实需求。', 'singleMain', '较高', '', ''),
	(27, 5, 13, '情绪管理', 0, 24, '您的情绪会立刻表达和发泄出来，缺少有效的办法控制自己的情绪，您的负面情绪对您自身的影响比较大，甚至影响到了您的正常生活和工作；您的情绪很容易受到外界的影响；如果您身边的人觉得您的脾气不是很好，这会对您的人际交往带来一定的负面影响。', '建议您试着学习体察别人情绪和控制自己情绪的技巧。比如在紧张和焦虑的时候，进行适度的深呼吸和冥想练习，会是一个很好的方法。学习和练习减压的技巧，让自己紧张的状态能够得到一定程度的放松和休息。', 'singleMain', '较低', '', ''),
	(28, 5, 13, '情绪管理', 25, 34, '一般情况下，遇到心情不好的时候，您会表现出来，但是大部分情况下，这些情绪是在您的控制之下，尽量不让情绪失控，从而影响到您的工作和生活。', '建议您在一定程度上提升自己的情绪管理能力，将压力和焦虑调整到一个适中的位置，这样您既不会感到烦躁和沮丧，也不会觉得懒散和无味。', 'singleMain', '中等', '', ''),
	(29, 5, 13, '情绪管理', 35, 999, '您的情绪不易受到外界环境的影响；您对他人情绪状态的觉知能力比较好，也会合理地控制自己的情绪；您的情绪表达对您的工作和生活起到了正面的、积极的作用，因为您知道在什么时候应该表达什么样的情绪，并且大部分时候能够达到您要的效果。', '建议您在一定范围和程度上保持您的乐观向上的情绪状态；您的情绪不易受他人等外在环境的影响，但可能存在忽略其他人情绪的可能，建议在保持对自己情绪状态觉知的同时，多留意周围人的情绪，利用自己的优势，合理疏导。', 'singleMain', '较高', '', ''),
	(30, 5, 14, '行为表现', 0, 24, '您最近状态不佳，一直觉得疲劳，工作效率也不如以前那么高；注意力和记忆力较之前有所下降；而且，工作和生活中经常会出现一些本来可以避免的错误，从而给自己带来了许多不必要的麻烦。', '您应该认真地关注自己的行为表现，改掉一些不良的生活习惯和行为方式；在生活和工作中，多注意一些细节问题；在完成任务时，需要积极调整好当时的状态，同时集中注意力，加大身心能量投入。', 'singleMain', '较低', '', ''),
	(31, 5, 14, '行为表现', 25, 33, '您最近的状态一般，偶尔会感觉到疲劳，但是适当休息后，能够马上恢复状态。您的工作效率与以前相比，没有太大变化，注意力、记忆力等也与之前差不多。您偶尔会有一些不良的生活方式，偶尔还会出现一些小错误。', '您应该对自己的行为和表现给予一定的关注，改掉一些不良的生活习惯；在工作中重视细节问题，减少因为马虎等带来的不必要的小错误。', 'singleMain', '中等', '', ''),
	(32, 5, 14, '行为表现', 34, 999, '您最近的状态比较好，精力比较旺盛，不太容易出现疲劳；注意力和记忆力都比以往要好；您在工作和生活中，做事认真负责，很少出现因马虎大意而犯错误。', '您应该继续保持您的良好状态，保持您所拥有的良好生活工作习惯；如果偶尔出现状态不好的时候，建议不必太过担心，用你自己擅长的方法，及时调整自己。', 'singleMain', '较高', '', ''),
	(33, 5, 15, '生理症状', 0, 26, '您最近的身体已经出现很多不适症状，已经开始影响到您的工作和生活；当遇到压力事件时，您可能会出现头疼、背疼、食欲不振等身体症状；晚上入睡困难，睡眠状态较差，继而影响到白天的工作和生活。', '您的身体健康状况已经出现不少问题，建议您参加一些运动力度不大的体育项目，如瑜伽、慢跑等，增强体质，同时，养成良好的生活作息习惯，如早睡早起，多吃水果蔬菜，戒掉或者减少不良生活习惯等。另外，做一些冥想练习，也能帮助您适当减轻焦虑，放松身心。', 'singleMain', '较低', '', ''),
	(34, 5, 15, '生理症状', 27, 36, '您的身体偶尔会出现一些小毛病，比如头疼、恶心、食欲不振等；您的睡眠状态一般，比如偶尔会出现入睡困难，睡醒后感觉还是很累等。但是这些小毛病基本上没有干扰到您的正常生活。', '您的身体已经出现一些小症状，建议您从现在开始及时关注自己的身体状况，参加一些体育项目，增强体质；同时，您需要养成良好的生活作息习惯；在压力较大时，多积极采取减压措施，如音乐减压、冥想减压等方法。', 'singleMain', '中等', '', ''),
	(35, 5, 15, '生理症状', 37, 999, '您最近的身体状态还不错，没有出现明显的身体不适；您的睡眠也比较好，一般能快速及时入睡，整个睡眠质量也不错，醒来后能够感觉身体得到了休息，精神状态得到了恢复。', '您现在的身体状况不错，建议您继续保持您的良好的作息习惯和有效的减压方法；如果您参加了各种体育锻炼，那么您需要继续保持这种练习。', 'singleMain', '较高', '', ''),
	(36, 5, 16, '社会支持', 0, 25, '您不太善于人际交往，不太喜欢社交活动；即使身处于热闹的人群中，也会觉得“狂欢是他们的，孤单是自己的”；能够交心的朋友没几个，很少有人能够走近您的内心；在遇到问题的时候，也不知道能找谁帮忙。', '改变一些消极的人际关系观念，积极主动参加或者组织一些社交活动，比如组织朋友看电影、吃饭、唱歌等娱乐活动，也可以多参加一些读书会、读书沙龙等活动，认识一些新朋友。在与人交流和沟通时，多主动一些，适当的时候可以倾诉自己的内心，让别人能够更容易与您亲近。', 'singleMain', '较低', '', ''),
	(37, 5, 16, '社会支持', 26, 34, '在日常生活中，您与他人的交往没有什么太大问题，只是在人多的场合，可能会有轻微焦虑。当遇到问题时，虽然能够求助的朋友不多，但是还是有个别能够交心的朋友。', '多参加一些社交活动，锻炼自己的社交能力；在公众场合多发表自己的观点，慢慢习惯成为众人关注的焦点；扩展您的朋友圈，虽然志同道合的朋友比较难找，但是当您以更加开放的心态对待自己和对待他人时，您的朋友圈也会慢慢壮大。', 'singleMain', '中等', '', ''),
	(38, 5, 16, '社会支持', 35, 999, '在日常生活中，您还是比较擅长与人打交道，在多数情况下，您能有效地表达自己的观点；当您成为众人的焦点时，也不会引发特别强烈的焦虑，您具有一定的应对能力；您在人多的场合也能表现自如；您有不少朋友，当遇到问题时，如果想找朋友帮忙，您总能找到合适的朋友。', '您比较重视家人和身边的朋友，也不缺少志同道合的朋友，但是因为朋友圈交往对象范围比较广，要特别注意跟朋友的交往的深度；另外，适当地留一些独处时间，将内心的方向转向自己，多关注自己的内在世界。', 'singleMain', '较高', '', ''),
	(39, 5, 17, '自我防御', 0, 24, '在工作和生活中，当您遇到突发状况时，您的应对方式有待提升，或者缺少相应的应对方法和技巧，不能够成熟和健康地处理问题。这种不成熟的自我防御机制容易影响到工作和生活。', '遇到突发事件时，在没做出任何反应之前，应当给出一点时间先冷静分析问题，从而找到解决问题的方法，切勿让自己的冲动破坏了整个事情。在观察周围人成熟冷静的行事风格的同时，多学习，多进步，使自己的个性更加健康和成熟。', 'singleMain', '较低', '', ''),
	(40, 5, 17, '自我防御', 25, 32, '您在生活和工作中，当遇到突然状况时，您的应对方式体现出成熟又幼稚的特点，也就是说，一部分情况下您能成熟应对之，而在另外一些情况下，您又没有成熟的应对方式，相对处理得比较幼稚。', '建议您多观察和学习周边人成熟、冷静的做事风格；您可以尝试努力使自己处理问题的时候更加理性、成熟；当遇到挫折时，可虚心接受自己的缺点或不足，努力提升自己。', 'singleMain', '中等', '', ''),
	(41, 5, 17, '自我防御', 33, 999, '您在日常工作和学习中，处理问题比较成熟、稳重；对环境的变化能够及时、迅速地调整自己，以应对这种变化；整体来说，您在行为反应上让周围的人觉得您是可靠和稳重的。', '您处理问题的时候很成熟稳重，应对突发状况的能力很强。建议您在成功应对各种问题之后，适当地给自己放松、充电和补充能量。', 'singleMain', '较高', '', ''),
	(42, 5, 11, '总分', 0, 144, '', '', 'teamMain', '较差', '', ''),
	(43, 5, 11, '总分', 145, 167, '', '', 'teamMain', '不良', '', ''),
	(44, 5, 11, '总分', 168, 191, '', '', 'teamMain', '中等', '', ''),
	(45, 5, 11, '总分', 192, 215, '', '', 'teamMain', '较好', '', ''),
	(46, 5, 11, '总分', 216, 240, '', '', 'teamMain', '非常好', '', ''),
	(47, 5, 12, '积极心态', 0, 999, '员工在评估个体关于日常生活中某些问题的观念、看法和认识的时候趋于以一种消极的观点，这样会使得他们对未来生活较为悲观，信心不足，自我价值观较低，也不能充分信任周围环境和他人，因此体验到的幸福感较低。', '', 'teamMain', '', '积极心态与心理健康有密切的关系。个体对客观事物的认知方式和认知态度，对其情绪情感以及行为有决定性作用，一个人的认知—情感—行为是否和谐，对健康会产生直接的影响。错误的认知会使我们产生不合理的情绪，不合理的情绪又会导致过激的行为。', ''),
	(48, 5, 13, '情绪管理', 0, 999, '员工的情绪管理能力比较差，有情绪会立刻表达和发泄出来，他们找不到有效的办法控制自己的情绪，而且他们容易受到负面情绪的影响，甚至会影响到了工作。', '', 'teamMain', '', '情绪是人对客观事物的态度体验，是人类大脑的一个检测系统。积极情绪有协调作用，而消极情绪则有破坏和瓦解作用。比如愤怒就会让人无法专注于眼前的工作，因此，情绪管理与心理健康关系相当密切。', ''),
	(49, 5, 14, '行为表现', 0, 999, '员工最近工作状态较差，工作效率较以前有所下降；而且，他们在工作和生活中经常会出现一些本来可以避免的错误，从而最近的工作带来了许多不必要的麻烦。', '', 'teamMain', '', '行为表现是指在各种动机的触发下、个体的状态的引导下，以及情绪的影响下所表现出来的行为上的表现情况。行为是个体最直接、可观察、可记录的一种表现，我们往往会从行为表现去推测个体的状况、情绪、能力，等等。员工团体的行为表现又直接关系到企业的效率、业绩、发展等。', ''),
	(50, 5, 15, '生理症状', 0, 999, '员工最近的身体已经出现很多不适症状，已经开始影响到工作和生活。特别是遇到压力事件时，总会伴随出现各种生理症状，如头疼、背疼、胃口不好、睡眠状态不好，导致白天身体状态跟不上。', '', 'teamMain', '', '身体是革命的本钱。在一定程度上，生理症状对工作和生活影响不大，但是，当生理状况达到警戒线以下，差到影响到工作和生活的时候，必须给以特别的关注。', ''),
	(51, 5, 16, '社会支持', 0, 999, '员工在人际交往互动中的状况不够理想。他们可能在有些情况下不能有效地表达自己的观点，特别是在有很多人的社交场合，常常会觉得不自然不舒服，常会感到孤独失落，但又很少主动找别人聊天谈心。', '', 'teamMain', '', '良好的人际关系可以缓解心理压力，促进心理健康；而不好的人际关系，却会很容易让人产生心理障碍。因为：良好的人际关系意味着，具有较多的朋友，人际关系和谐，因此人们之间可以互相关心，互相爱护，互相帮助，这样就可以降低心理压力，化解心理障碍，有利于心理健康；而不良的人际关系则意味着，缺乏知心密友，有话不想说也不能说，“把所有问题自己扛”，这样很容易把心理问题积蓄和放大起来，也就容易产生心理障碍。', ''),
	(52, 5, 17, '自我防御', 0, 999, '员工在工作和生活中遇到突发状况时，应对方式还停留在比较幼稚的阶段，不够稳重，或者说缺乏应对的方法和技巧，不能够成熟地处理问题。这种不成熟的自我防御机制容易影响到工作和生活。', '', 'teamMain', '', '自我防御机制是指在遇到外在环境突然变化等应激事件时，个体所表现出来的应对能力。在工作和生活中，难免会遇到突然情况，如果个体或者整个团体对外界变化的应对能力比较强，那么会比较适合在充满激烈竞争，且不断变化的环境中工作。', ''),
	(53, 7, 51, '情绪感知/自我情绪感知', 1, 1, '完全不清楚自己的情绪状况，也完全不关注自己的情绪。', '', 'singleSub', '', '', ''),
	(54, 7, 51, '情绪感知/自我情绪感知', 2, 2, '对自己的情绪状况了解得极少，不知道自己情绪为何变化。', '', 'singleSub', '', '', ''),
	(55, 7, 51, '情绪感知/自我情绪感知', 3, 3, '不清楚自己的情绪状况，也没有对自己的情绪给予足够的关注。', '', 'singleSub', '', '', ''),
	(56, 7, 51, '情绪感知/自我情绪感知', 4, 4, '虽然关注过自己的情绪，但不太能够把握时时自己的情绪状况。', '', 'singleSub', '', '', ''),
	(57, 7, 51, '情绪感知/自我情绪感知', 5, 5, '偶尔能清楚自己的情绪状况，但还有很大提升空间。', '', 'singleSub', '', '', ''),
	(58, 7, 51, '情绪感知/自我情绪感知', 6, 6, '比较能把握自己的情绪状况，很多情况下对引起自己情绪的原因也比较清楚。', '', 'singleSub', '', '', ''),
	(59, 7, 51, '情绪感知/自我情绪感知', 7, 7, '可以清楚地把握自己的情绪状况，也清楚自己伴随情绪出现的生理反应和非言语信息。', '', 'singleSub', '', '', ''),
	(60, 7, 51, '情绪感知/自我情绪感知', 8, 8, '关注自己的情绪，清楚自己的情绪状态，将其作为行动的依据', '', 'singleSub', '', '', ''),
	(61, 7, 51, '情绪感知/自我情绪感知', 9, 9, '非常关注自己的情绪，也非常清楚自己的情绪，能够把它成为行动的基础。', '', 'singleSub', '', '', ''),
	(62, 7, 51, '情绪感知/自我情绪感知', 10, 10, '完全清楚自己的情绪状况，也非常清楚伴随自己情绪的生理反应。', '', 'singleSub', '', '', ''),
	(63, 7, 52, '情绪感知/他人情绪感知', 1, 1, '完全不了解他人情绪状态，不能站在别人角度想问题，不能体察别人情绪，很自我中心。', '', 'singleSub', '', '', ''),
	(64, 7, 52, '情绪感知/他人情绪感知', 2, 2, '对他人情绪状态的了解极其有限，也无法站在别人的角度设身处地地对待问题，有自我中心倾向，很难与人相处。', '', 'singleSub', '', '', ''),
	(65, 7, 52, '情绪感知/他人情绪感知', 3, 3, '不了解他人情绪，无法站在他人角度为别人着想，容易以自我为中心，与人相处经常会遇到困难。', '', 'singleSub', '', '', ''),
	(66, 7, 52, '情绪感知/他人情绪感知', 4, 4, '虽然有时会关注他人情绪，但是没有能力设身处地为别人着想，考虑他人感受。', '', 'singleSub', '', '', ''),
	(67, 7, 52, '情绪感知/他人情绪感知', 5, 5, '偶尔会关注其他人的情绪感受，也能在某些时候为他人着想，能够站在他人角度对待问题。', '', 'singleSub', '', '', ''),
	(68, 7, 52, '情绪感知/他人情绪感知', 6, 6, '比较能关注他人的情绪和感受，试图理解他人传递的语言和非语言信息，在很多情况下，有能力体谅和照顾他人情绪和感受。', '', 'singleSub', '', '', ''),
	(69, 7, 52, '情绪感知/他人情绪感知', 7, 7, '可以清楚地认识和体会到别人传达的情绪，并且根据理解的情绪，照顾别人的感受，从而做出相应的行为。', '', 'singleSub', '', '', ''),
	(70, 7, 52, '情绪感知/他人情绪感知', 8, 8, '很好地识别他人情绪，并以此不断调整自己的行为。', '', 'singleSub', '', '', ''),
	(71, 7, 52, '情绪感知/他人情绪感知', 9, 9, '识别他人情绪的高手，对别人的情绪非常敏感，能捕捉细节来推测他人情绪。别人都能和你愉快相处。', '', 'singleSub', '', '', ''),
	(72, 7, 52, '情绪感知/他人情绪感知', 10, 10, '完全把握别人情绪，与任何人几乎都能和谐相处。在日常工作和生活中，经常把照顾别人的情绪放在重要位置上。', '', 'singleSub', '', '', ''),
	(73, 7, 53, '情绪控制/稳定性', 1, 1, '情绪极不稳定，很容易波动，特别容易紧张。周围人也觉得你脾气古怪。', '', 'singleSub', '', '', ''),
	(74, 7, 53, '情绪控制/稳定性', 2, 2, '常常有情绪的很大波动，遇到事情容易紧张，经常处于悲观状态。', '', 'singleSub', '', '', ''),
	(75, 7, 53, '情绪控制/稳定性', 3, 3, '情绪不稳定，容易悲观，容易动怒，也比较容易紧张。', '', 'singleSub', '', '', ''),
	(76, 7, 53, '情绪控制/稳定性', 4, 4, '情绪稳定性一般，但是遇到重大事件，还是容易紧张。', '', 'singleSub', '', '', ''),
	(77, 7, 53, '情绪控制/稳定性', 5, 5, '情绪偶尔有波动，但是起伏很小，偶尔也会紧张，但是会尽力调节。', '', 'singleSub', '', '', ''),
	(78, 7, 53, '情绪控制/稳定性', 6, 6, '情绪比较稳定，在很多情况下，都不会那么悲观和丧气，也不会大喜大悲。', '', 'singleSub', '', '', ''),
	(79, 7, 53, '情绪控制/稳定性', 7, 7, '情绪有弹性，遇到事情沉着冷静。', '', 'singleSub', '', '', ''),
	(80, 7, 53, '情绪控制/稳定性', 8, 8, '情绪弹性好，大家都觉得你比较成熟，沉着冷清。', '', 'singleSub', '', '', ''),
	(81, 7, 53, '情绪控制/稳定性', 9, 9, '情绪稳定性好，不容易悲观，也不容易大怒，遇到重要场合也不易紧张，应付得体，收放自如。', '', 'singleSub', '', '', ''),
	(82, 7, 53, '情绪控制/稳定性', 10, 10, '情绪非常稳定，遇到重大场合也很从容。且情绪基调积极向上，充满正能量。', '', 'singleSub', '', '', ''),
	(83, 7, 54, '情绪控制/控制力', 1, 1, '完全不能调节自己的情绪，只能任由其发生、发展。', '', 'singleSub', '', '', ''),
	(84, 7, 54, '情绪控制/控制力', 2, 2, '调节自己情绪的能力很差，尝试调节情绪，但是无法', '', 'singleSub', '', '', ''),
	(85, 7, 54, '情绪控制/控制力', 3, 3, '情绪调节能力差，无法延长或者摆脱某些情绪状态。', '', 'singleSub', '', '', ''),
	(86, 7, 54, '情绪控制/控制力', 4, 4, '偶尔能够意识到调节自己情绪状态，但是还是没有有效的方法达到满意的结果。', '', 'singleSub', '', '', ''),
	(87, 7, 54, '情绪控制/控制力', 5, 5, '偶尔能够有办法调节自己情绪状态，在某些时候，能够延长或者摆脱某些情绪状态。', '', 'singleSub', '', '', ''),
	(88, 7, 54, '情绪控制/控制力', 6, 6, '有一定的情绪调节能力，但是有时候还是控制不住自己的情绪，不能立刻恢复状态。还有一定的改进空间。', '', 'singleSub', '', '', ''),
	(89, 7, 54, '情绪控制/控制力', 7, 7, '情绪调节能力比较强，情绪控制得比较好，情绪恢复起来没有太多困难。', '', 'singleSub', '', '', ''),
	(90, 7, 54, '情绪控制/控制力', 8, 8, '有很好的情绪调节能力，能够主动调节自己的情绪状况，从或高或低的情绪中恢复正常。', '', 'singleSub', '', '', ''),
	(91, 7, 54, '情绪控制/控制力', 9, 9, '擅长情绪自我调节和控制，有自己的方法和措施来掌控自己的情绪状态，情绪恢复起来又快又好。', '', 'singleSub', '', '', ''),
	(92, 7, 54, '情绪控制/控制力', 10, 10, '控制情绪的高人，能够根据情绪状态对自己的有利程度，能动性地调节自己的情绪，使得自己马上能从高昂和压抑的情绪中恢复过来。', '', 'singleSub', '', '', ''),
	(93, 7, 55, '情绪控制/自我激励', 1, 1, '当遇到挑战和挫折时，没有任何方法进行自我鞭策，也没有办法进行自我激励。', '', 'singleSub', '', '', ''),
	(94, 7, 55, '情绪控制/自我激励', 2, 2, '自我激励的水平很差，没有办法给自己鼓劲儿，一遇到挫折就容易退缩。', '', 'singleSub', '', '', ''),
	(95, 7, 55, '情绪控制/自我激励', 3, 3, '当遇到挑战和挫折时，没有办法进行有效的自我鞭策、自我说服，达不到自我激励的效果。', '', 'singleSub', '', '', ''),
	(96, 7, 55, '情绪控制/自我激励', 4, 4, '偶尔能够自我安慰和为自己打气，但是因为方法不到位，起不了太大的作用。', '', 'singleSub', '', '', ''),
	(97, 7, 55, '情绪控制/自我激励', 5, 5, '偶尔能够自我安慰和为自己打气，有时也会起到一些作用。', '', 'singleSub', '', '', ''),
	(98, 7, 55, '情绪控制/自我激励', 6, 6, '有一定的自我激励能力，想法在某些程度上得到改善，但是行动力有时会不足。', '', 'singleSub', '', '', ''),
	(99, 7, 55, '情绪控制/自我激励', 7, 7, '自我激励能力较强，只要是下定决心为自己鼓劲，虽然时间较长，但是还是能起到一定作用。', '', 'singleSub', '', '', ''),
	(100, 7, 55, '情绪控制/自我激励', 8, 8, '有很好的自我激励能力，总能从挫折和困难中找回自己的信心和热情。', '', 'singleSub', '', '', ''),
	(101, 7, 55, '情绪控制/自我激励', 9, 9, '面对自己的目标，能够随时进行有效的自我鞭策和自我说服，以此来保持自己对目标的热情、专注和自制。', '', 'singleSub', '', '', ''),
	(102, 7, 55, '情绪控制/自我激励', 10, 10, '一直会有效地自我鞭策和自我说服，以此来保持自己的热情、专注和自制。周围的人都觉得你干劲十足。', '', 'singleSub', '', '', ''),
	(103, 7, 56, '社交技巧/表达', 1, 1, '与别人相处时，表达情绪不适宜，不注意表达情绪的场合和时机，面部表情和肢体语言不够丰富，不能适时对别人表示赞扬。', '', 'singleSub', '', '', ''),
	(104, 7, 56, '社交技巧/表达', 2, 2, '情绪表达很差，经常在不知情的情况下得罪他人。有时与他人相处会出现情绪引发的误会。', '', 'singleSub', '', '', ''),
	(105, 7, 56, '社交技巧/表达', 3, 3, '虽然自己会注意情绪表达，但是情绪表达水平不高。', '', 'singleSub', '', '', ''),
	(106, 7, 56, '社交技巧/表达', 4, 4, '在某些场合，会表达出合适的情绪，但是在其他一些场合的情绪表达会差强人意。', '', 'singleSub', '', '', ''),
	(107, 7, 56, '社交技巧/表达', 5, 5, '在某些特别的场合，会注意自己的情绪表达，也会“三思而后表达”。', '', 'singleSub', '', '', ''),
	(108, 7, 56, '社交技巧/表达', 6, 6, '有一定的情绪表达能力，在一些常见情绪的处理和表达上比较到位，细微情绪的处理还有提高空间。', '', 'singleSub', '', '', ''),
	(109, 7, 56, '社交技巧/表达', 7, 7, '情绪表达得体且到位，在表达情绪前会观察时机和场所，再调整自己情绪表达的尺度。', '', 'singleSub', '', '', ''),
	(110, 7, 56, '社交技巧/表达', 8, 8, '有很好的情绪表达能力，喜欢与别人分享情感，与周围人能愉快相处。', '', 'singleSub', '', '', ''),
	(111, 7, 56, '社交技巧/表达', 9, 9, '能够根据时机和场所表达合适的情绪，也不吝啬对别人的夸赞。别人与之相处比较愉快。', '', 'singleSub', '', '', ''),
	(112, 7, 56, '社交技巧/表达', 10, 10, '情绪表达的高手，总能恰到好处地表达出自己的情绪和状态，是一个很讨人喜欢的人。', '', 'singleSub', '', '', ''),
	(113, 7, 57, '社交技巧/适应力', 1, 1, '完全不善于处理人际关系，情绪改变不够灵活，对待别人糟糕的情绪经常束手无策。', '', 'singleSub', '', '', ''),
	(114, 7, 57, '社交技巧/适应力', 2, 2, '非常不善于处理人际关系，情绪灵活性很差，遇到有些人际冲突时完全不知道怎么班。', '', 'singleSub', '', '', ''),
	(115, 7, 57, '社交技巧/适应力', 3, 3, '情绪适应力差，经常用相同的状态对付不同的人，不善于处理人际关系。', '', 'singleSub', '', '', ''),
	(116, 7, 57, '社交技巧/适应力', 4, 4, '偶尔能够调整情绪以适应不同的人际关系，但总体来说情绪灵活性还不够。', '', 'singleSub', '', '', ''),
	(117, 7, 57, '社交技巧/适应力', 5, 5, '为了适应不同的人际关系，比较能够调整情绪，但是偶尔会出现处理不了的人际关系。', '', 'singleSub', '', '', ''),
	(118, 7, 57, '社交技巧/适应力', 6, 6, '有一定的情绪灵活性，也比较能够妥善处理人际关系。', '', 'singleSub', '', '', ''),
	(119, 7, 57, '社交技巧/适应力', 7, 7, '情绪灵活性较强，能够改变自己以求面对不同群体。', '', 'singleSub', '', '', ''),
	(120, 7, 57, '社交技巧/适应力', 8, 8, '善于处理人际关系，在不同的人际交往中，有很强的情绪适应力。', '', 'singleSub', '', '', ''),
	(121, 7, 57, '社交技巧/适应力', 9, 9, '非常擅长处理人际关系，对付不同的人有不同的办法，情绪适应力高。', '', 'singleSub', '', '', ''),
	(122, 7, 57, '社交技巧/适应力', 10, 10, '极度善于处理人际关系，能够灵活调整和改变自己的情绪，能够适应各种情况下遇到的别人的情绪状态。', '', 'singleSub', '', '', ''),
	(123, 7, 58, '社交技巧/感染力', 1, 1, '自己的情绪对别人的情绪没有任何影响力，无法调动周围人的情绪，也不擅长鼓励别人。', '', 'singleSub', '', '', ''),
	(124, 7, 58, '社交技巧/感染力', 2, 2, '自己的情绪对别人的情绪几乎没有什么影响力，在鼓励他人方面也不擅长。', '', 'singleSub', '', '', ''),
	(125, 7, 58, '社交技巧/感染力', 3, 3, '情绪感染力差，调动他人情绪方面能力较差。', '', 'singleSub', '', '', ''),
	(126, 7, 58, '社交技巧/感染力', 4, 4, '有情感流露，他人能够感受到，但是无法将他人情绪调动起来', '', 'singleSub', '', '', ''),
	(127, 7, 58, '社交技巧/感染力', 5, 5, '偶尔在某些讲话中有情感流露，能够打动部分听众。', '', 'singleSub', '', '', ''),
	(128, 7, 58, '社交技巧/感染力', 6, 6, '有一定的情绪感染力，能够调动周围人情绪，但演讲能力可以进一步提高。', '', 'singleSub', '', '', ''),
	(129, 7, 58, '社交技巧/感染力', 7, 7, '在与人交流过程中，善于将自己的情绪传递给他人，从而引导他人情绪变化。', '', 'singleSub', '', '', ''),
	(130, 7, 58, '社交技巧/感染力', 8, 8, '有很强的情绪感染力，在说话过程中善于调动他人情绪，善于鼓励他人，善于演讲。', '', 'singleSub', '', '', ''),
	(131, 7, 58, '社交技巧/感染力', 9, 9, '自己很容易赢得别人的信任，能充分影响和调动周围人的情绪，也非常擅长鼓励他人。', '', 'singleSub', '', '', ''),
	(132, 7, 58, '社交技巧/感染力', 10, 10, '可以随意调动周围人的情绪，是个演讲高手，也是大家信任的人。', '', 'singleSub', '', '', ''),
	(133, 7, 59, '情绪利用/问题解决', 1, 1, '没有意识到情绪可以促进问题解决，在遇到问题时没有考虑到情绪因素。', '', 'singleSub', '', '', ''),
	(134, 7, 59, '情绪利用/问题解决', 2, 2, '无法利用情绪帮助问题的解决，面对情绪影响的问题也不知道如何处理。', '', 'singleSub', '', '', ''),
	(135, 7, 59, '情绪利用/问题解决', 3, 3, '意识到情绪可以影响问题的解决，但是没有找到合适的办法，比较困扰。', '', 'singleSub', '', '', ''),
	(136, 7, 59, '情绪利用/问题解决', 4, 4, '明白适当的情绪有利于问题的解决，在某些时候也关注到了不利情绪，但是方法运用地还不够到位。', '', 'singleSub', '', '', ''),
	(137, 7, 59, '情绪利用/问题解决', 5, 5, '有一定解决问题能力，比较能够运用一些方法来改变和利用情绪，其最终目的是为了更好解决问题。', '', 'singleSub', '', '', ''),
	(138, 7, 59, '情绪利用/问题解决', 6, 6, '比较会利用情绪，主要体现在利用情绪本身的状态和情绪的改变来方便解决问题。', '', 'singleSub', '', '', ''),
	(139, 7, 59, '情绪利用/问题解决', 7, 7, '在工作和生活中，重视情绪对个人问题解决的影响，会改变与事件相关的情绪来促进问题解决。', '', 'singleSub', '', '', ''),
	(140, 7, 59, '情绪利用/问题解决', 8, 8, '有很强的问题解决能力，非常清楚情绪对个体思维的影响力，所以在解决问题前会先考虑解决情绪问题。', '', 'singleSub', '', '', ''),
	(141, 7, 59, '情绪利用/问题解决', 9, 9, '善于利用情绪促进问题解决，关注那些影响工作和任务的他人情绪，这是情绪管理的高级技能。', '', 'singleSub', '', '', ''),
	(142, 7, 59, '情绪利用/问题解决', 10, 10, '很会利用情绪促进问题的解决。根据与事件相关的情绪体验改变思维方向和事件轻重缓急的能力很强。', '', 'singleSub', '', '', '');
INSERT INTO `quiz_item` (`id`, `question`, `lieFlag`, `optionJson`, `groupId`, `createBy`, `createAt`, `updateBy`, `updateAt`, `quizId`) VALUES
	(1, '当我在工作时间打电话时，', 0, '[{\n   "index" :"A",\n   "content" :"一直都在谈论正题",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"在进入正题前先聊一会",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"不急于挂电话",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"谈话尽量简短",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(2, '如果我在办公室等别人来开会，可是他们迟到了，', 0, '[{\n   "index" :"A",\n   "content" :"我使自己一直忙于给他们打电话或工作，直到他们来了为止",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"我猜出他们可能会晚一会儿，不会感到不高兴",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"我会打电话给他们，以证实我没有记错时间",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"我觉得很恼火，因为他们浪费了我的时间",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(3, '当我与别人说话时，', 0, '[{\n   "index" :"A",\n   "content" :"始终都和对方保持目光接触",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"一会儿看着对方，一会儿向下看",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"谈话过程中大部分时间都在环顾四周",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"尽力想保持目光接触但又不时地把目光移开",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(4, '当客户正向我解释一个问题时，', 0, '[{\n   "index" :"A",\n   "content" :"我会尽量去理解并同情他的感受",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"查询有关这一问题的具体事实",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"认真听取主要内容以便找出解决办法",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"我运用身体语言和语音语调向他表示我听懂了",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(5, '当我参加工作会议时，', 0, '[{\n   "index" :"A",\n   "content" :"坐在后面，并在提出我的观点之前考虑一下我要说的内容",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"全盘托出我的计划，让大家都知道",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"热情洋溢地发表自己的观点，但同时也听取别人的意见",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"尽量支持会上他人的意见",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(6, '如果我正在和别人发生争执，', 0, '[{\n   "index" :"A",\n   "content" :"尽力把注意力放到积极因素上，从而使形势有所缓和",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"尽力保持冷静并且尽量理解争执的原因",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"尽量避免谈论引起争执的话题",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"马上正视争执以便于争执能尽快得到解决",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(7, '当我在众人面前发表意见时，', 0, '[{\n   "index" :"A",\n   "content" :"我很有趣且很幽默",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"条理清楚，言简意赅",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"相对而言，我的声音小",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"直接、具体、有时声音洪亮",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(8, '当我想使别人接受我的观点时，', 0, '[{\n   "index" :"A",\n   "content" :"我先听他们的观点然后很有礼貌地阐述自己的观点",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"我强烈地表达我的观点，以便使他们都能明白我的立场",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"我尽量说服他们，而不是把我的观点强加给他们",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"阐明观点时，会解释我的想法和理由",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(9, '当我被别人言语攻击时，', 0, '[{\n   "index" :"A",\n   "content" :"我会告诉他，请停止对我的攻击",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"我感到受了伤害，却什么都不对他说",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"分析型",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"我言辞激烈地告诉他我不喜欢他的行为",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(10, '当我想请同事帮忙，向他说明自己遇到的难题时，', 0, '[{\n   "index" :"A",\n   "content" :"我尽可能地告诉他问题的每一个细节",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"为了表明我的困境，我有时会把问题夸大",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"我尽可能说明问题给我带来的感受",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"我说明我多么希望问题能够得到解决",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(11, '当我与同事交流工作时，认为下面的哪一点最为重要？', 0, '[{\n   "index" :"A",\n   "content" :"效率高——不拐弯抹角，直奔主题，高效完成工作",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"逻辑强——谈话逻辑很重要，事先会准备好沟通要点",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"关系好——主动询问并尊重对方的看法和意见，维护好同事关系，营造和谐的气氛",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"表达清晰——洪亮且清晰地表达出自己的观点",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(12, '下面哪一个特质更加符合你？', 0, '[{\n   "index" :"A",\n   "content" :"为人热情且合群",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"做事雷厉风行、当机立断",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"有耐心、温文尔雅",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"逻辑性强、严肃认真",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(13, '与别人闲聊时，', 0, '[{\n   "index" :"A",\n   "content" :"我是说话又多又快的人",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"我喜欢听被人说话，自己说得比较少",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"我说话时经常配合手势",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"声音轻柔且抑扬顿挫",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
	(14, '如果听一次演讲，我更喜欢的讲师是', 0, '[{\n   "index" :"A",\n   "content" :"内在逻辑性强、严肃认真",\n   "categoryId" :5,\n   "categoryName" :"分析型",\n   "value" :10\n}, {\n   "index" :"B",\n   "content" :"生动、幽默",\n   "categoryId" :3,\n   "categoryName" :"表达型",\n   "value" :10\n}, {\n   "index" :"C",\n   "content" :"温文尔雅、善于鼓励别人",\n   "categoryId" :4,\n   "categoryName" :"和蔼型",\n   "value" :10\n}, {\n   "index" :"D",\n   "content" :"自信满满、语速快",\n   "categoryId" :2,\n   "categoryName" :"支配型",\n   "value" :10\n}]', 0, NULL, NULL, NULL, NULL, 3),
